import React, { Fragment, useState } from "react";
import { toast } from "react-toastify";

const AddPartial = ({ product, setProductsChange }) => {
  const addPartial = async (id) => {};

  return (
    <Fragment>
      <button
        type="button"
        className="btn btn-info"
        data-toggle="modal"
        data-target={`#id${product.product_stocklist_id}`}
      >
        Add Partial
      </button>

      <div className="modal" id={`id${product.product_stocklist_id}`}>
        <div className="modal-dialog">
          <div className="modal-content">
            <div className="modal-header">
              <h4 className="modal-title">Add Partial Bottle</h4>
            </div>
            <div className="modal-body"></div>
            <form>
                <input type="number" placeholder="0.00" step="0.05" min="0" max="1.0"></input>
            </form>
            <div className="modal-footer"></div>
          </div>
        </div>
      </div>
    </Fragment>
  );
};

export default AddPartial;
